.location-container-modal {
  >>> .el-dialog {
    .el-dialog__body {
      height: 62vh !important;
      overflow: hidden;
    }
    .location-contain {
      display: flex;
      flex-direction: column;
      height: 100%;
      padding: 0px 20px 0 20px;

      .map-contain {
        position: relative;
        .map {
          margin: 10px 0;
          width: 100%;
          height: 230px;
        }
        .map-marker {
          width: 19px;
          height: 32px;
          position: absolute;
          top: 50%;
          left: 50%;
          transform: translate(-50%, calc(-50% - 9.5px));
        }
      }

      .around-contain {
        width: 100%;
        height: 100%;
        overflow: auto;
        .el-radio-group {
          width: 100% !important;
        }
        .around-contain-item {
          width: 100%;
          padding: 8px;
          border-bottom: 1px solid #f2f2f6;
          display: flex;
          height: 60px;
          line-height: 22px;
          align-items: center;
          width: 100%;
          .around-item-title {
            color: #171a1d;
            width: 512px;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
          }
          .around-item-sub-title {
            color: #b9babb;
            width: 512px;
            overflow: hidden;
            text-overflow: ellipsis;
            white-space: nowrap;
          }
        }
        .around-contain-empty {
          height: 90%;
        }
      }
    }
  }
}
.location-card {
  display: flex;
  align-items: center;
  margin-top: 8px;
  background: #f2f2f6;
  padding: 12px;
  border-radius: 8px;
  justify-content: space-between;
  cursor: pointer;
  .location-card-info {
    flex: 1;
    display: flex;
    align-items: center;
    .location-card-static-map {
      width: 48px;
      height: 48px;
      margin-right: 4px;
    }
    .location-card-address {
      line-height: 1.5;
      padding: 0 4px;
      word-break: normal;
      white-space: normal;
    }
  }
  .location-card-actions {
    color: rgb(135, 143, 149);
    cursor: pointer;
    flex-shrink: 0;
  }
}
